/*Table structure for table `word` */

DROP TABLE IF EXISTS `word`;

CREATE TABLE `word` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `jph` varchar(50) NOT NULL,
  `jpk` varchar(50) NOT NULL,
  `sp` varchar(50) NOT NULL,
  `en` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

/*Data for the table `word` */

insert  into `word`(`id`,`jph`,`jpk`,`sp`,`en`) values (1,'いぬ','イヌ','perro','dog'),(2,'ねこ','ネコ','gato','cat'),(3,'うし','ウシ','vaca','cow'),(4,'かめ','カメ','tortuga','turtle');

